// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {UserManagement} from  "./UserManagement.sol";
import {ProductManagement} from  "./ProductManagement.sol";
import {Event} from "../library/Event.sol";



contract PaymentProcessing  {
    IERC20 public emaxToken;
    UserManagement private userManagement;
    ProductManagement private productManagement;

    mapping(address => uint256) public payments;




    constructor(address _tokenAddress, address userManagementAddress, address productManagementAddress) {
        emaxToken = IERC20(_tokenAddress);
        userManagement = UserManagement(userManagementAddress);
        productManagement = ProductManagement(productManagementAddress);

    }

    /**
     * @notice Processes a payment for the total amount in the user's cart.
     * @param _user Address of the user making the payment.
     */
    function processPayment(address _user) external  {
        uint256 total = calculateTotal();
        require(emaxToken.balanceOf(_user) >= total, "Insufficient balance");
        require(emaxToken.transferFrom(_user, address(this), total), "Failed to transfer tokens");

        payments[_user] += total;
        userManagement.clearCart(_user); // Clear cart after successful payment
        emit Event.PaymentProcessed(_user, total);
        emit Event.PurchaseCompleted(_user, total);
    }

    /**
     * @notice Calculates the total cost of all items in the user's cart.

     * @return total The total cost of the cart.
     */
    function calculateTotal() public view returns (uint256 total) {
        total = 0;
        UserManagement.CartItem[] memory cart = userManagement.getCartItems();
        for (uint i = 0; i < cart.length; i++) {
            uint256 productPrice = productManagement.productPrice(cart[i].productId);
            total += productPrice * cart[i].quantity;
        }
        return total;
    }

    function mintToken(address _receiver) external {
    require(_receiver != address(0), "Invalid address: zero address");
    emaxToken.mint(_receiver, 10000); // Mint 10,000 tokens to the specified address
}


    /**
     * @notice Adds a user to the payment processor role.
     * @param user Address of the new payment processor.
     */

}

contracts/services/ProductManagement.sol.content:
// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.9;
import {Event} from "../library/Event.sol";

contract ProductManagement  {


    Product[] public productList;
    mapping(uint => Product) products;
    uint256 public productIdCounter;
    mapping(address => bool) public isAdmin;  // @notice  Mapping to track admin privileges

    address owner;


    enum ProductStatus { Available, OutOfStock, Discontinued }

    struct Product {
        uint256 id;
        bytes32 productName;
        bytes32 productDescription;
        bytes32 productImage;
        uint256 productQuantity;
        uint256 productPrice;
        ProductStatus status;
    }

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner(){
        require(owner == msg.sender, "not authorize");
        _;
    }

    modifier onlyAdmin() {
        if (!isAdmin[msg.sender]) revert ("NOT_AUTHORIZE()");
        _;
    }


    function addProduct(
        bytes32 _productName,
        bytes32 _productDescription,
        bytes32 _productImage,
        uint256 _productQuantity,
        uint256 _productPrice
    ) public onlyAdmin {
        productIdCounter++;
        Product storage _product = products[productIdCounter];
        _product.id = productIdCounter;
        _product.productName = _productName;
        _product.productDescription = _productDescription;
        _product.productImage = _productImage;
        _product.productQuantity = _productQuantity;
        _product.productPrice = _productPrice;
        _product.status = ProductStatus.Available;

        productList.push(_product);
        emit Event.ProductAdded(productIdCounter, _productName);
    }

    function updateProductStatus(uint256 _productId, ProductStatus _status) public onlyAdmin {
        require(_productId > 0 && _productId <= productIdCounter, "Invalid product ID");
        products[_productId - 1].status = _status;
        emit Event.ProductUpdated(_productId,uint8(_status));
    }

    function checkProductAvailability(uint256 _productId, uint256 _quantity) public returns (bool) {
        require(_productId > 0 && _productId <= productList.length, "Invalid product ID");
        bool isAvailable = products[_productId - 1].productQuantity >= _quantity && products[_productId - 1].status == ProductStatus.Available;
        emit Event.ProductAvailabilityChecked(_productId, isAvailable);
        return isAvailable;
    }

    function getAllProducts() public view returns (Product[] memory) {
        return productList;
    }

    function productPrice(uint _id) external view returns(uint) {
        return products[_id].productPrice;
    }

    function addAdmin(address _admin) external onlyOwner {
        require(_admin != address(0), "invalid Address zero");
        if (isAdmin[_admin]) revert ("NOT_AUTHORIZE()");
        isAdmin[_admin] = true;
        emit Event.AdminAdded(_admin);
    }
}

contracts/services/ShipmentManagement.so.content:
// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.9;

import {Event} from "../library/Event.sol";
import {Error} from "../library/Error.sol";

contract ShipmentManagement {

   mapping(address => Shipment[]) public shipments;
   mapping(address => bool) public isAdmin;  // @notice  Mapping to track admin privileges

   uint256 public shipmentCount;
   address owner;


    struct Shipment {
        address sender;
        address receiver;
        uint256 pickupTime;
        uint256 deliveryTime;
        uint256 distance;
        ShipmentStatus status;
        bool isPaid;
    }

    enum ShipmentStatus { PENDING, IN_TRANSIT, DELIVERED }





    constructor() {
        owner = msg.sender;
    }

     modifier onlyAdmin() {
        if (!isAdmin[msg.sender]) revert ("NOT_AUTHORIZE()");
        _;
    }

       modifier onlyOwner(){
        require(owner == msg.sender, "not authorize");
        _;
    }

    function createShipment(address receiver, uint256 pickupTime, uint256 distance) external onlyAdmin {
        Shipment memory newShipment = Shipment({
            sender: msg.sender,
            receiver: receiver,
            pickupTime: pickupTime,
            deliveryTime: 0,
            distance: distance,
            status: ShipmentStatus.PENDING,
            isPaid: false
        });
        shipments[msg.sender].push(newShipment);
        shipmentCount++;

        emit Event.ShipmentCreated(msg.sender, receiver, pickupTime, distance);
    }

    function startShipment(address sender, uint256 index) external onlyAdmin {
        Shipment storage shipment = shipments[sender][index];
        require(shipment.status == ShipmentStatus.PENDING, "Shipment is not pending");
        shipment.status = ShipmentStatus.IN_TRANSIT;

        emit Event.ShipmentInTransit(sender, shipment.receiver, shipment.pickupTime);
    }

    function completeShipment(address sender, uint256 index) external onlyAdmin {
        Shipment storage shipment = shipments[sender][index];
        require(shipment.status == ShipmentStatus.IN_TRANSIT, "Shipment not in transit");
        shipment.status = ShipmentStatus.DELIVERED;
        shipment.deliveryTime = block.timestamp;

        emit Event.ShipmentDelivered(sender, shipment.receiver, shipment.deliveryTime);
    }


    function addAdmin(address _admin) external onlyOwner {
        require(_admin != address(0), "invalid Address zero");
        if (isAdmin[_admin]) revert ("NOT_AUTHORIZE()");
        isAdmin[_admin] = true;
        emit Event.AdminAdded(_admin);
    }

    function getShipment(address sender, uint256 index) external view returns (Shipment memory) {
        return shipments[sender][index];
    }

    function getShipmentCount(address sender) external view returns (uint256) {
        return shipments[sender].length;
    }
}

